import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click multiple "Add to Cart" buttons rapidly
    const addToCartButtons = await page.$$('.add-to-cart');

    // Rapidly click first 5 add to cart buttons
    for (let i = 0; i < Math.min(5, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      await page.waitForTimeout(100); // Short delay between clicks
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_added.png'));

    // Wait for and click cart element
    const cartElement = await page.waitForSelector('.cart', { timeout: 5000 });
    await cartElement.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_view.png'));

    // Wait for and click checkout button
    const checkoutButton = await page.waitForSelector('.checkout-btn', { timeout: 5000 });
    await checkoutButton.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_checkout.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_checkout.png'));

    // Extract cart data
    const cartCount = await page.$eval('.cart', el => el.textContent.trim());
    const cartItems = await page.$$('.cart-item');

    return {
      success: true,
      action: "Added multiple items to cart and proceeded to checkout",
      extractedData: {
        cartCount,
        cartItems: cartItems.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
